      SELECT ALL + col0 FROM tab2 (FORMAT parquet) WHERE NOT ( NULL ) NOT BETWEEN ( ( col2 ) + col2 ) AND + col1 * + CAST ( - 80 AS INTEGER ) * + col0 + - - ( col1 ) + 97 * 78;
  - name: tab2

outputs:
  - name: q9873.out
    data: |
